import React,{Component} from 'react';
import {Link,NavLink} from 'react-router-dom';
class Nav extends Component{
    render(){
        //3ashan amna3 7eta el reload ba3mel import l hagten Link ow NavLink 

        return(
            <div className="navigation">
              <div className="logo">
                  logo
              </div>
              <div className="lists">
               <Link href="/">Home</Link>
               <Link href="/about"> About</Link>

              </div>
            </div>
        )
    }

  
  
}

export default Nav;
